import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

import iconSupplements from '../images/iconSupplements.png';
import iconInjury from '../images/iconInjury.png';
import iconIllness from '../images/iconIllness.png';
import iconSkin from '../images/iconSkin.png';
import iconDisinfectant from '../images/iconDisinfectant.png';
import iconMedicalTools from '../images/iconMedicalTools.png';

import boldSupplements from '../images/boldSupplements.png';
import boldInjury from '../images/boldInjury.png';
import boldIllness from '../images/boldIllness.png';
import boldSkin from '../images/boldSkin.png';
import boldDisinfectant from '../images/boldDisinfectant.png';
import boldMedicalTools from '../images/boldMedicalTools.png';

const fatihicon = "https://www.flaticon.com/free-icons/supplement";

function PopupModal() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <p><a className="link" onClick={handleShow}>Flaticon and Pexels attribution</a></p>

      <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Attributions</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>Flaticon Attributions</p>
          <ul>
            <li><img className="mini-icon" src={iconSupplements} alt="Supplements icon"/> created by <a className="link" title="supplement icons" href={fatihicon} target="_blank" rel="noreferrer noopener">fatihicon</a></li>
          </ul>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="primary" onClick={handleClose}>Close</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default PopupModal;
